import { Outlet } from "react-router-dom";
import SideBar from "./components/sidebar";

const PageLayout = () => {
    return (
        <div className='bg-orange-50'>
            <div className="px-80 flex flex-row">
                <SideBar/>
                <Outlet/>
            </div>
        </div>
      )
}

export default PageLayout;
